import Test from "./components/test";
function App() {
    const [loginStatus, setLoginStatus] = useState(false); 

   return (
    <BrowserRouter> 
     <div className="App">

     </div>  
        <Routes>
           <Route path='/login' exact element={ localStorage.getItem("token") ? <Login/> : none} />
           <Route path='/dashboard' exact element={  <SlideMenu /> } />
           <Route path='/test' exact element={<Test/>} />

        </Routes>
      </BrowserRouter>  
);


}

export default App;
